--
-- Estrutura da tabela `card_cuidados`
--

DROP TABLE IF EXISTS `card_cuidados`;
CREATE TABLE IF NOT EXISTS `card_cuidados` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cc_imagem` varchar(max) NOT NULL,
  `cc_titulo` varchar(200) NOT NULL,
  `cc_texto` varchar(500) NOT NULL,
  PRIMARY KEY (`id`),  
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

--
-- Estrutura da tabela `bandeira`
--

DROP TABLE IF EXISTS `bandeira`;
CREATE TABLE IF NOT EXISTS `bandeira` (
  `id` int(11) NOT NULL AUTO_INCREMENT,    
