  `bd_imagem` varchar(max) NOT NULL,
  PRIMARY KEY (`id`),  
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

--
-- Estrutura da tabela `alerta`
--

DROP TABLE IF EXISTS `alerta`;
CREATE TABLE IF NOT EXISTS `alerta` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `al_id_bandeira` int(11) NOT NULL,
  `al_data_inicio` date NOT NULL,
  `al_data_fim` date NOT NULL,
  `al_titulo` varchar(100) NOT NULL,
  `al_texto` varchar(300) NOT NULL,
  PRIMARY KEY (`id`),  
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

--
-- Estrutura da tabela `usuario`
