  `id` int(11) NOT NULL AUTO_INCREMENT,    
  `pp_nome` varchar(300) NOT NULL,
  `pp_tipo` varchar(1) NOT NULL,
  `pp_email` varchar(100) NOT NULL,
  `pp_fone_1` varchar(15),
  `pp_fone_2` varchar(15),
  `pp_documento` varchar(20),
  `pp_id_atividade` int(11) NOT NULL,
  `pp_id_rua` int(11) NOT NULL,
  `pp_numero` int(11) NOT NULL,
  `pp_complemento` varchar(30),
  `pp_imagem` varchar(max),
  `pp_mensagem` varchar(500),
  `pp_feriado` bit NOT NULL,
  `pp_ativo` bit NOT NULL,
  PRIMARY KEY (`id`),  
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

